    data: |
      SELECT cor0.col0 FROM tab0 (FORMAT parquet) cor0 WHERE - col2 <> ( col2 ) OR NOT - col2 * + cor0.col0 NOT BETWEEN - col0 / col0 AND col1 * - col0;
  - name: tab0

outputs:
  - name: q2370.out
    data: |
      24
      35
      89
